@jit(complex128(complex128[:,:],int64,int64,float64,float64,float64[:],float64[:]), nopython=True, cache=True)
def E1(f, i, n, mu, U0, dU, J):
	Ef = 0
	Ef = -(mu*n*f[i,n].conjugate()*f[i,n]) - 0.5*n*U0*f[i,n].conjugate()*f[i,n] - 0.5*n*f[i,n].conjugate()*dU[i]*f[i,n] + 0.5*U0*f[i,n].conjugate()*f[i,n]*pow(n,2.) + 0.5*f[i,n].conjugate()*dU[i]*f[i,n]*pow(n,2.)
	return Ef

@jit(complex128(complex128[:,:],int64,int64,int64,int64,float64,float64,float64[:],float64[:]), nopython=True, cache=True)
def E2(f, i, j1, j2, n, mu, U0, dU, J):
	Ef = 0
	Ef = -(f[i,1 + n].conjugate()*f[j2,n].conjugate()*f[i,n]*f[j2,1 + n]*g(n,1 + n)*J[i]) - f[i,1 + n].conjugate()*f[j1,n].conjugate()*f[i,n]*f[j1,1 + n]*g(n,1 + n)*J[j1]
	return Ef

