def E(f, L, nmax, mu, W, xi, scale):
	fin = f.reshape((L, nmax+1))
	U0 = U0t(W)
	Wi = W * xi
	U = Ut(Wi)
	dU = U - U0
	J = Jt(Wi)
	Ef = 0


	for i in range(L):
		k1 = (i-2) % L
		j1 = (i-1) % L
		j2 = (i+1) % L
		k2 = (i+2) % L
		for n in range(nmax+1):
			Ef += E1(fin, i, n, mu, U0, dU, J)
			if n < nmax:
				Ef += E2(fin, i, j1, j2, n, mu, U0, dU, J)
				for m in range(1, nmax+1):
					if n != m-1:
						Ef += E3(fin, i, j1, j2, n, m, mu, U0, dU, J)
						for p in range(nmax):
							Ef += E4(fin, i, j1, j2, k1, k2, n, m, p, mu, U0, dU, J)
							for q in range(1, nmax+1):
								if p != q-1:
									Ef += E5(fin, i, j1, j2, k1, k2, n, m, p, q, mu, U0, dU, J)
									if n-m == p-q:
										Ef += E6(fin, i, j1, j2, k1, k2, n, m, p, q, mu, U0, dU, J)
									else:
										Ef += E7(fin, i, j1, j2, k1, k2, n, m, p, q, mu, U0, dU, J)

	return Ef/scale
